import React from 'react';
import TrailersLanding from '../Component/TrailersLanding';
import { Switch, Route } from 'react-router-dom';

const Routes = () =>{
    <Switch>
        <Route exact path="/" component={TrailersLanding}/>

    </Switch>
}
export default Routes;
